import './Boxes.css';
import dog from './dog.png';

const Boxes = ({ name }) => {
	return (
		<div>
			<h1 className='f1'>PetWorld</h1>
			<br/><br/><br/><br/><br/>
			<div className="white f3">
			{`${name}, pick your favorite pet and fill out an application`}
			</div>
			<br/><br/><br/>
				<div className="card">
					<img src={dog} alt="golden"/>
					<div className="container">
					<h4><b>Golden Retriever</b></h4>
					<p>Price</p>
					</div>
					<img src={dog} alt="golden"/>
